import './App.css';
import {useState} from 'react'

function App() {
  const [name, setName] = useState('')
  const [password, setPassword] = useState('')
  const [email, setEmail] = useState('')


  return (
    <body>
      <div>
        <header>
          <a class="logo" href="/Volumes/sambashare/code/myBlogv2/client/src/._e90.jpeg">
            <p class="logoP1">Bimmer</p>
            <p>Book</p>
          </a>
        </header>
      </div>
    <div>
      <form>
        <input
          value={name}
          onChange={(e) => setName(e.target.value)}
          type="text"
          placeholder="name"
        />
        <br></br>
        <input
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          type="text"
          placeholder="email"
        />
        <br></br>
        <input
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          type="text"
          placeholder="password"
        />
      </form>
      <br/>
      <button>
        Submit
      </button>

    </div>
    </body>
  );
}

export default App;
